	(91,2,0,2,NULL,1,1,0,0,'jonsons-the-masque-of-blackness-1','image','default','Jonson\'s The Masque of Blackness','','',NULL,'The first collaboration by poet and playwright Ben Jonson and architect and designer Inigo Jones, this royal spectacle helped to make the court masque a private entertainment favored by James I and his court. It featured pageantry, music, dance, lavish costumes and scenery, and a cast of court ladies, led by Queen Anne, dressed up in blackface as African women. &nbsp;<p></p>','[]',NULL,NULL,NULL,NULL,'2016-03-10 19:22:12','2016-03-10 19:22:12'),
