	(721,8,39,2,NULL,1,1,0,0,'lotus-eaters','image-map','maptour','Lotus Eaters','<p><b>Directions</b></p><ul><li>Lotus Eaters&nbsp;opens to Leopold Bloom walking&nbsp;East along Sir John Rogerson’s Quay, past an eczema-scarred child.</li><li>Turn to your&nbsp;right onto Limestreet.</li><li>Follow Bloom walking&nbsp;east on Great Brunswick, now&nbsp;Hanover Street.</li><li>Head&nbsp;south&nbsp;towards the Post Office on&nbsp;Westland Row&nbsp;across from Nichols the Undertaker’s. [See sign on left hand side]</li><li>Letter in hand, Bloom does a curious thing….</li><li>Retrace his steps back up Westland Row, turn&nbsp;right onto&nbsp;Pearse St, where he discards his letter by the overpass on&nbsp;South Cumberland St.</li><li>Now follow Bloom in the side entrance of&nbsp;All Hallow’s Church. It’s now called St Andrew’s.</li><li>Reemerge, as Bloom did, on&nbsp;Westland Row.</li><li>Turn&nbsp;left towards Lincoln Place, (where Bloom meets Bantam Lyons).</li><li>Watch for Sweny’s chemist on your&nbsp;right&nbsp;hand side.</li><li>Search out&nbsp;Leinster Lane, where Bloom went for his Turkish bath.</li><li>Lotus Eaters&nbsp;opens to Leopold Bloom walking&nbsp;East along Sir John Rogerson’s Quay, past an eczema-scarred child.</li><li>Turn to your&nbsp;right onto Limestreet.</li><li>Follow Bloom walking&nbsp;east on Great Brunswick, now&nbsp;Hanover Street.</li><li>Head&nbsp;south&nbsp;towards the Post Office on&nbsp;Westland Row&nbsp;across from Nichols the Undertaker’s. [See sign on left hand side]</li><li>Letter in hand, Bloom does a curious thing….</li><li>Retrace his steps back up Westland Row, turn&nbsp;right onto&nbsp;Pearse St, where he discards his letter by the overpass on&nbsp;South Cumberland St.</li><li>Now follow Bloom in the side entrance of&nbsp;All Hallow’s Church. It’s now called St Andrew’s.</li><li>Reemerge, as Bloom did, on&nbsp;Westland Row.</li><li>Turn&nbsp;left towards Lincoln Place, (where Bloom meets Bantam Lyons).</li><li>Watch for Sweny’s chemist on your&nbsp;right&nbsp;hand side.</li><li>Search out&nbsp;Leinster Lane, where Bloom went for his Turkish bath.</li></ul><p></p>','',NULL,'','[]',NULL,NULL,NULL,NULL,'2016-08-22 14:17:34','2016-08-31 15:57:09'),
