	(726,8,5,2,NULL,1,1,0,0,'all-hallows-church','audio','simple','All Hallows Church','<blockquote style=\"margin: 0 0 0 40px; border: none; padding: 0px;\"><p><em>\"He had reached the open backdoor of All Hallows. Stepping into the porch he doffed his hat, took the card from his pocket and tucked it again behind the leather headband\" (77).&nbsp;</em></p><p><em>\"The cold smell of sacred stone called him. He trod the worn steps, pushed the swingdoor and entered softly through the rere\"</em>&nbsp;(77).&nbsp;</p></blockquote><p>All Hallow’s Church was built by the wealthy Catholic middle classes in 1832.<span style=\"font-size: 1.3125rem; line-height: 1.5; background-color: rgb(255, 255, 217);\">&nbsp;</span></p><p><b>What\'s There Now:</b></p><p>All Hallow\'s Church still stands today.&nbsp; Thanks to its recent renovation, you can now see it in all its former glory.</p><p><strong>Directions:</strong></p><p>Enter through the swinging door.&nbsp;</p><p></p>','',NULL,'','[]',NULL,NULL,NULL,NULL,'2016-08-22 15:21:49','2016-08-22 15:41:29'),
