	(739,8,12,2,NULL,1,1,0,0,'folder-grid-simple-details','folder','grid-simple','Folder - Grid Simple- Details','<p>Introduction:&nbsp;The research findings from the field of&nbsp;<a href=\"http://www.sfn.org/about/about-neuroscience\" class=\"external\" target=\"_blank\" rel=\"noreferrer\">Neuroscience&nbsp;(Links to an external site.)</a>&nbsp;are very relevant to social work. The field of social work needs highly trained professionals who understand the personal and environmental dimensions of development, including the biological dimension. These four online SCWK7721 Neuropsychology Learning Modules are an introduction to some of those important topics relevant to your work in policy and practice. The BCSSW offers electives that cover all of the topics addressed in the modules in more detail. In these 4 brief modules we provide an opportunity to learn about some of this cutting-edge research so that you may integrate it with your understanding of required readings and in-class discussions. There is a unique and growing bridge between social work and neuroscience, and you as the next generation of social workers are in a very unique position to pioneer new thinking, research, practice and policy that connect the two fields.</p><p></p><p>Directions:</p><ol><li>We expect that each learning module will be completed in consecutive order (see due dates below).</li><li>Each module will take approximately 1-2 hours to complete.</li><li>Complete each module in order as you read through it.</li><li>The modules include text, websites links, PowerPoint slides, images, videos, and audio interviews.</li><li>Please read all written text on the module and view all videos. We expect that you will look through any additional links to learn more, but do not feel you need to exhaustively read everything on a linked website or memorize a picture or PowerPoint slide, for example.&nbsp;</li><li>You may complete a learning module in one sitting, or take breaks and cover it over a few weeks. For example, for Module 1 you may wish to read through the material at various points that work with your schedule during weeks 1, 2, and 3 so you have some time to think about and digest the material before we begin to cover it in class beginning Session 3.</li><li>We recognize that much of this material is new to you, and ask that you arrive to class having completed the assigned module and ready to talk about it (we do not expect you to be experts on the first pass).</li><li>Your instructor will give you more specific detail about how the material will be used in your class.</li><li>All instructors expect that you will address the biological dimension of development (also with the psychological and the social) in Final Exam Question 1. One way to do this is to use what you learned in these modules and cite it as personal communication in that essay.&nbsp;<br></li></ol><p>Due Dates:</p><ul><li>Module 1: Social Health&nbsp;(brain, stress, food, housing) is&nbsp;due by Session 3&nbsp;&nbsp;(suggested viewing is over weeks 1, 2 and 3)<br></li><li>Module&nbsp;2: Social Connections&nbsp;(early life adversity, attachment, caregiver skills) is&nbsp;due by Session 6&nbsp;&nbsp;(suggested viewing is over weeks 4, 5, and 6)<br></li><li>Module 3: Social Self&nbsp;(identity development, peer relationships, risk taking) is&nbsp;due by Session 9&nbsp;&nbsp;(suggested viewing is over weeks 7, 8 and 9)<br></li><li>Module 4: Social Resilience&nbsp;(aging, social connections and positive emotion) is&nbsp;due by Session 12&nbsp; (suggested viewing is over weeks 10, 11 and 12)</li></ul><p></p>','',NULL,'Here are some extra details.<p></p>','{\"defaultSidebar\":\"description\"}',NULL,NULL,NULL,NULL,'2016-08-23 13:00:13','2016-08-25 20:45:52'),
