	(745,8,0,2,NULL,1,1,0,0,'bradys-cottages','image','default','Brady\'s Cottages','<i>\"By Brady\'s cottages a boy for the skins lolled, his bucket of offal linked, smoking a chewed fagbutt\" (68).</i>','',NULL,'','[]',NULL,NULL,NULL,NULL,'2016-08-23 22:19:31','2016-08-23 22:19:31'),
	(746,8,0,2,NULL,1,1,0,0,'priest','audio','default','Priest','<blockquote style=\"margin: 0 0 0 40px; border: none; padding: 0px;\"><p>\"The priest bent down to put it into her mouth, murmuring all the time. Latin\" (77).</p></blockquote><p>In 1904, the language of the Irish Catholic mass was Latin, and would remain so until the Second Vatican Council (1962-1965) decided to hold service in the vernacular.</p><p>The sacrament of the Eucharist in Latin mass began with the priest offering the bread saying, \"Corpus Domini nostri Jesu Christi custodiat animam tuam in vitam aeternam. Amen.\" (trans: \"May the Body of our Lord Jesus Christ preserve your soul unto everlasting life. Amen\"). The recipient would simply respond, “Amen.\"</p><p>The Latin ritual is significantly more comprehensive than our modern \"Body of Christ\" version, and would have seemed to the common man, as Bloom imagines, \"stupefying.\"</p><p><b>Directions:&nbsp;</b></p><p>Exit the front door of the Church and turn left onto Westland Road</p><p></p>','',NULL,'','[]',NULL,NULL,NULL,NULL,'2016-08-23 22:21:20','2016-08-23 22:21:20'),
	(747,8,3,2,NULL,1,1,0,0,'a-smaller-girl','audio','simple','A Smaller Girl','<blockquote style=\"margin: 0 0 0 40px; border: none; padding: 0px;\"><p><em>\"A smaller girl with scars of eczema on her forehead eyed him, listlessly holding her battered caskhoop\"</em>&nbsp;(68).</p></blockquote><p>The caskhoop presumably refers to the children’s game of hoop and stick (also called, “hoop rolling”), in which a child uses a stick to roll a thin hoop.&nbsp;&nbsp;The game would still have been played by Irish children in 1904, although it can be found on Greek vases dating back to 500 BCE. No doubt a cask hoop from a Guinness barrel would have served nicely for this purpose.</p><p><a href=\"http://www.sdcoe.k12.ca.us/colonial/projects/Colonial%20Games.pdf\" target=\"_blank\">Colonial Games</a></p><p></p>','',NULL,'','[]',NULL,NULL,NULL,NULL,'2016-08-23 22:24:56','2016-08-31 18:58:33'),
