	(1298,13,10,2,2,1,1,0,0,'geojson-1','osm','default','Geojson Overlay','\n                                    <section class=\"module-content\"><p></p><p>The Renewable Energy Atlas of Vermont and this dataset were created to assist town energy committees, the Clean Energy Development Fund and other funders, educators, planners, policy-makers, and businesses in making informed decisions about the planning and implementation of renewable energy in their communities - decisions that ultimately lead to successful projects, greater energy security, a cleaner and healthier environment, and a better quality of life across the state. Energy flows through nature into social systems as life support. Human societies depended on renewable, solar powered energy for fuel, shelter, tools, and other items for most of our history. Today, when we flip on a light switch, turn an ignition or a water faucet, or eat a hamburger, we engage complex energy extraction systems that largely rely on non-renewable energy to power our lives. About 90% of Vermont\'s total energy consumption is currently generated from non-renewable energy sources. This dependency puts Vermont at considerable risk, as the peaking of world oil production, global financial instability, climate change, and other factors impact the state.</p><p></p></section><section class=\"information module-content\" id=\"access-use\"></section>                                                                      \n                                ','',NULL,'<a href=\"https://catalog.data.gov/dataset/vt-potential-hydroelectric-sites\">VT Potential Hydroelectric Sites</a>.&nbsp;Vermont Center for Geographic Information<p></p><p></p>                                                      ','[]',NULL,NULL,NULL,NULL,'2017-10-25 15:27:25','2017-10-25 15:37:33'),
